 (31768, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class="rss-widget"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2016/12/moving-toward-ssl/\'>Moving Toward SSL</a> <span class="rss-date">December 1, 2016</span><div class="rssSummary">We’re at a turning point: 2017 is going to be the year that we’re going to see features in WordPress which require hosts to have HTTPS available. Just as JavaScript is a near necessity for smoother user experiences and more modern PHP versions are critical for performance, SSL just makes sense as the next hurdle [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=\'rsswidget\' href=\'https://wptavern.com/state-of-the-word-2016-mullenweg-pushes-calypso-as-future-of-wordpress-interface-proposes-major-changes-to-release-cycle\'>WPTavern: State of the Word 2016: Mullenweg Pushes Calypso as Future of WordPress’ Interface, Proposes Major Changes to Release Cycle</a></li><li><a class=\'rsswidget\' href=\'https://poststatus.com/matt-mullenweg-state-word-2016/\'>Post Status: Matt Mullenweg State of the Word, 2016</a></li><li><a class=\'rsswidget\' href=\'https://ma.tt/2016/12/wordcamp-live-stream/\'>Matt: WordCamp Live Stream</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Popular Plugin:</span> Google Analytics Dashboard for WP&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=google-analytics-dashboard-for-wp&amp;_wpnonce=b894e35596&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Install Google Analytics Dashboard for WP">(Install)</a></li></ul></div>', 'no'),
