INSERT INTO `wp_posts` VALUES (141333768, 232011119, '2016-01-19 15:16:17', '2016-01-19 15:16:17', 'The 9064LS is the latest aerodynamic breakthrough in the Speedline \nseries that started it all. Faster clubhead speed, less drag and a more \npiercing ball flight results in more yardage off the tee for golfers of \nall swing speeds. "Adams Golf engineers have made dynamic improvements in\n this fourth generation" that will give golfers, from weekend enthusiasts\n to tour pros and even the big bombers of the World Long Drive \nChampionship', 'Golf-Clubs Drivers Adams 9064ls', '', 'publish', 'open', 'open', '', 'golf-clubs-drivers-adams-9064ls', '', '', '2016-01-19 15:16:17', '2016-01-19 15:16:17', '', 0, '', 0, 'post', '', 0, 464325),
 (210986642, 232011119, '2016-01-19 14:46:34', '2016-01-19 14:46:34', 'While I have yet to try the Nextt Titra X 460cc Driver in a game of \ngolf, I have tried it on the driving range.  What this means is that I \ndo not yet know how its distance compares with my Ping G5&#39;s distance, I \ncan say, however, I do believe I will be able to control the direction \nof my drive better with the Titra driver. I like the feel of the Titra \nand this boosts my confidence that it will work well for me next week \nwhen I give it a try on a golf course.', 'Golf-Clubs Drivers Acer Golf Tetra X', '', 'publish', 'open', 'open', '', 'golf-clubs-drivers-acer-golf-tetra-x', '', '', '2016-01-19 14:46:34', '2016-01-19 14:46:34', '', 0, '', 0, 'post', '', 0, 464539),
 (315500436, 232011119, '2016-01-06 14:46:41', '2016-01-06 14:46:41', 'this is new article to test.<br />', 'Golf-Clubs Drivers Arrowtech Aermet Alloy', '', 'publish', 'open', 'open', '', 'golf-clubs-drivers-arrowtech-aermet-alloy', '', '', '2016-01-06 14:46:41', '2016-01-06 14:46:41', '', 0, '', 0, 'post', '', 0, 335254),
